import { Component } from "react";

export default class Artist extends Component{
    constructor(props){
        super(props);
        this.state = {
            error: null,
            isLoaded: false,
            artists: []
        };
    }
    componentDidMount(){
        fetch("/api/songcollection/artists")
        .then(res => res.json())
        .then(
            (result) => {
                this.setState({
                    isLoaded: true,
                    artists: result.artists
                })
            }
        )
    }
    render(){
        const {isLoaded, artists} = this.state
        if(!isLoaded){
            return <div>Loading...</div>
        }
        return <div>
            <div>Hi</div>
            (
            <ul>
            {artists.map(artist => (
                <li key={artist.uuid}>
                {artist.name} {artist.isActive}
                </li>
            ))}
            </ul>
        )</div>
    }
}
